import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { 
  FaPython, FaJs, FaReact, FaNodeJs, FaHtml5, FaCss3Alt, 
  FaJava, FaGitAlt, FaGithub, FaLinux, FaDocker, FaDatabase,
  FaCode, FaServer, FaBolt, FaShieldAlt, FaRocket,
  FaKey, FaImage
} from 'react-icons/fa';
import { SiTypescript, SiExpress, SiDjango, SiMongodb, SiPostgresql, SiPostman, SiInsomnia } from 'react-icons/si';

const About = () => {
  const [hoveredSkill, setHoveredSkill] = useState(null);

  const skillCategories = {
    Languages: [
      { name: 'Python', icon: FaPython, color: '#3776ab', experience: '3 years' },
      { name: 'JavaScript', icon: FaJs, color: '#f7df1e', experience: '3 years' },
      { name: 'TypeScript', icon: SiTypescript, color: '#3178c6', experience: '2 years' },
      { name: 'Java', icon: FaJava, color: '#ed8b00', experience: '2 years' },
      { name: 'C++', icon: FaCode, color: '#00599c', experience: '2 years' },
      { name: 'C', icon: FaCode, color: '#a8b9cc', experience: '1 year' },
      { name: 'HTML', icon: FaHtml5, color: '#e34f26', experience: '3 years' },
      { name: 'CSS', icon: FaCss3Alt, color: '#1572b6', experience: '3 years' },
      { name: 'SQL', icon: FaDatabase, color: '#336791', experience: '2 years' }
    ],
    Frameworks: [
      { name: 'React', icon: FaReact, color: '#61dafb', experience: '2 years' },
      { name: 'Node.js', icon: FaNodeJs, color: '#339933', experience: '2 years' },
      { name: 'Express', icon: SiExpress, color: '#000000', experience: '2 years' },
      { name: 'Django', icon: SiDjango, color: '#092e20', experience: '1 year' },
      { name: 'Django Channels', icon: SiDjango, color: '#092e20', experience: '1 year' }
    ],
    'Developer Tools': [
      { name: 'Git', icon: FaGitAlt, color: '#f05032', experience: '3 years' },
      { name: 'GitHub', icon: FaGithub, color: '#181717', experience: '3 years' },
      { name: 'Linux', icon: FaLinux, color: '#fcc624', experience: '2 years' },
      { name: 'Docker', icon: FaDocker, color: '#2496ed', experience: '1 year' },
      { name: 'MongoDB', icon: SiMongodb, color: '#47a248', experience: '2 years' },
      { name: 'PostgreSQL', icon: SiPostgresql, color: '#336791', experience: '1 year' },
      { name: 'WebSockets', icon: FaBolt, color: '#ff6b35', experience: '1 year' },
      { name: 'JWT/Auth', icon: FaKey, color: '#000000', experience: '2 years' },
      { name: 'Cloudinary', icon: FaImage, color: '#3448c5', experience: '1 year' },
      { name: 'REST APIs', icon: FaServer, color: '#ff6b35', experience: '2 years' },
      { name: 'Postman', icon: SiPostman, color: '#ff6c37', experience: '2 years' },
      { name: 'Insomnia', icon: SiInsomnia, color: '#4000bf', experience: '1 year' },
      { name: 'CI/CD', icon: FaRocket, color: '#ff6b35', experience: '1 year' },
      { name: 'Testing', icon: FaShieldAlt, color: '#28a745', experience: '1 year' }
    ],
    Libraries: [
      { name: 'Mongoose', icon: FaDatabase, color: '#47a248', experience: '2 years' },
      { name: 'Express', icon: SiExpress, color: '#000000', experience: '2 years' },
      { name: 'Django Channels', icon: SiDjango, color: '#092e20', experience: '1 year' }
    ]
  };

  return (
    <section id="about" className="about-section">
      <div className="container">
        <motion.h2
          className="section-title"
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
        >
          About Me
        </motion.h2>

        <div className="about-content">
          <motion.div
            className="bio-section"
            initial={{ opacity: 0, x: -50 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8, delay: 0.2 }}
            viewport={{ once: true }}
          >
            <h3>Professional Bio</h3>
            <p>
              I'm a passionate Full-Stack Engineer and Software Developer with a strong foundation in 
              backend architecture and frontend development. I specialize in building scalable web 
              applications using modern technologies and best practices.
            </p>
            <p>
              My experience spans from designing complete backend systems with REST APIs to creating 
              responsive user interfaces. I'm particularly interested in real-time applications, 
              authentication systems, and cloud-based solutions.
            </p>

            <div className="education">
              <h4>Education</h4>
              <div className="education-item">
                <strong>University of California San Diego (UCSD)</strong>
                <p>B.S. Computer Engineering</p>
                <p>San Diego, CA | Expected Graduation: December 2026</p>
              </div>
            </div>
          </motion.div>

          <motion.div
            className="skills-section"
            initial={{ opacity: 0, x: 50 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8, delay: 0.4 }}
            viewport={{ once: true }}
          >
            <h3>Technical Skills</h3>
            {Object.entries(skillCategories).map(([category, skills]) => (
              <div key={category} className="skill-category">
                <h4>{category}</h4>
                <div className="skills-grid">
                  {skills.map((skill, index) => {
                    const IconComponent = skill.icon;
                    return (
                      <motion.div
                        key={skill.name}
                        className="skill-item"
                        whileHover={{ 
                          scale: 1.1, 
                          rotate: 5,
                          boxShadow: `0 10px 25px ${skill.color}40`
                        }}
                        whileTap={{ scale: 0.95 }}
                        onHoverStart={() => setHoveredSkill(skill)}
                        onHoverEnd={() => setHoveredSkill(null)}
                        initial={{ opacity: 0, y: 20 }}
                        whileInView={{ opacity: 1, y: 0 }}
                        transition={{ duration: 0.5, delay: index * 0.1 }}
                        viewport={{ once: true }}
                      >
                        <div 
                          className="skill-icon"
                          style={{ color: skill.color }}
                        >
                          <IconComponent size={24} />
                        </div>
                        <span className="skill-name">{skill.name}</span>
                        {hoveredSkill === skill && (
                          <motion.div
                            className="skill-tooltip"
                            initial={{ opacity: 0, y: 10 }}
                            animate={{ opacity: 1, y: 0 }}
                            exit={{ opacity: 0, y: 10 }}
                          >
                            {skill.experience} experience
                          </motion.div>
                        )}
                      </motion.div>
                    );
                  })}
                </div>
              </div>
            ))}
          </motion.div>
        </div>
      </div>

      <style jsx>{`
        .about-section {
          min-height: 100vh;
          padding: 100px 0;
          background: var(--secondary-dark);
        }

        .section-title {
          text-align: center;
          font-size: 48px;
          font-weight: 700;
          margin-bottom: 80px;
          color: var(--text-light);
        }

        .about-content {
          display: grid;
          grid-template-columns: 1fr 1fr;
          gap: 80px;
          align-items: start;
        }

        .bio-section h3,
        .skills-section h3 {
          font-size: 32px;
          font-weight: 600;
          margin-bottom: 30px;
          color: var(--accent-blue);
        }

        .bio-section p {
          font-size: 18px;
          line-height: 1.8;
          margin-bottom: 20px;
          color: var(--text-light);
          opacity: 0.9;
        }

        .education {
          margin-top: 40px;
        }

        .education h4 {
          font-size: 24px;
          font-weight: 600;
          margin-bottom: 20px;
          color: var(--text-light);
        }

        .education-item {
          background: rgba(37, 99, 235, 0.1);
